initial_sparql:
SELECT 
    ?comment1 
    ?comment2 
    (COUNT(*) as ?count)
WHERE {
    ?protein a up:Protein ;
            up:annotation ?annotation1, ?annotation2 . 
    ?annotation1 rdf:type up:Topological_Domain_Annotation ;
                rdfs:comment ?comment1 .
    ?annotation2 rdf:type up:Topological_Domain_Annotation ;
                rdfs:comment ?comment2 .
    FILTER (?comment1 < ?comment2)
} 
GROUP BY ?comment1 ?comment2 
ORDER BY DESC(?count)
